import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import img from '../../assets/logo512.png';

const Header = () => {
	return (
        <table style={{width:100 + '%'}}>
        <tbody>
        <tr>
          <td>

              <Link to="/">
                  <img src={img} alt = "Logo" style = {{ width:75, height:75, marginLeft: 5 + 'vw', marginTop: 0 + 'vh', float:'left'}} />
              </Link>
          </td>
          <td>
              <div>1APP AI</div>
          </td>

          <td style={{width:25 + '%', miWidth: 156}}>
              <Link to="/login">
                  <button className = "login-btn" style = {{float:'right', marginRight: 5 + 'vw'}}>Login</button>
              </Link>

          </td>

        </tr>
        </tbody>
      </table>
	);
};

export default Header;
